import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";
import CreateArea from "./CreateArea";


function App() {
   return (
      <div>
         <Header />
         <CreateArea />
         <Note key={1} title="Note title" content="Note content" />
         <Footer />
      </div>
   );
}

export default App;
